        id: json["id"],
        title: json["title"],
        slug: json["slug"],
        summary: json["summary"],
        category: json["category"],
        tag: List<String>.from(json["tag"].map((x) => x)),
        content: json["content"],
        image: Image.fromJson(json["image"]),
        publishedAt: DateTime.parse(json["published_at"]),
      );

